enum ComposedEvent {
    RequestResponse(RequestResponseEvent<GenericRequest, GenericResponse>),
    Kademlia(KademliaEvent),
    Mdns(MdnsEvent),
    Gossipsub(GossipsubEvent),
}

enum Command {
    StartListening {
        addr: Multiaddr,
        sender: oneshot::Sender<Result<(), Box<dyn Error + Send>>>,
    },
    Dial {
        peer_id: PeerId,
        peer_addr: Multiaddr,
        sender: oneshot::Sender<Result<(), Box<dyn Error + Send>>>,
    },
    StartProviding {
        file_name: String,
        sender: oneshot::Sender<()>,
    },
    GetProviders {
        file_name: String,
        sender: oneshot::Sender<HashSet<PeerId>>,
    },
    GetClosestPeers {
        id: PeerId,
        sender: oneshot::Sender<Vec<PeerId>>,
    },
    Request {
        peer: PeerId,
        request: GeneralRequest,
        sender: oneshot::Sender<Result<String, Box<dyn Error + Send>>>,
    },
    Respond {
        response: GeneralResponse,
        channel: ResponseChannel<GenericResponse>,
    },
    BootRoot {
        up_root: String,
        sender: oneshot::Sender<()>,
    },
}

pub enum Event {
    InboundRequest {
        request: String,
        channel: ResponseChannel<GenericResponse>,
    },
}

pub enum InsertResult {
    Complete,
    InsertOnRemoteParent(BlockId, Key, BlockId),
}

pub enum GeneralRequest {
    LeaseRequests(Vec<GeneralRequest>),
    LeaseRequest(Key, Entry),
    MigrateRequest(Block),
    InsertOnRemoteParent(Key, BlockId),
}

pub enum GeneralResponse {
    LeaseResponse(PeerId),
    MigrateResponse,
    InsertOnRemoteParent(PeerId),
}

enum CliArgument {
    Provide {
        path: PathBuf,
        name: String,
    },
    Get {
        name: String,
    },
    BeRoot {
        name: String,
    },
    GetLease {
        name: String,
        data: String,
    },
}
